import './App.css';
import React, {useState} from "react";
import Clock from "react-live-clock";
import OutLink from "./outLink";
import DecoIMG from "./decoIMG";



function App() {
    const [status, setStatus] = useState(false);

    const openModal = () => {
        setStatus(!status);
    };

  return (
      <>
          <div className="upper_box">
            <div className="icon"></div>
            <div className="icon2"></div>
            <Clock className="real_time" format={'HH:mm:ss'} ticking={true}/>
          </div>

          <div className="items">
              <OutLink/>
              <OutLink/>
              <DecoIMG/>
              <DecoIMG/>
              {status ? (
                  <div onClick={openModal} style={style.set_body}>
                      <div onClick={openModal} style={style.set_box}>이미지 들어갈 자리</div>
                  </div>
              ):null}
          </div>

          <div className="footer">
            KyungHee Univ. Dicon 2021 Degree Show
          </div>
      </>
  );
}
const style = {
    set_box: {
        width: '70vw',
        height: '70vh',
        backgroundColor: "blue",
        position: 'relative',
        margin:'auto',
    },
    set_body: {
        display: 'flex',

    },
}
export default App;
